description:
Want to take great action shots, stunning landscapes and shoot impressive sunset, snow-scapes and night-time scenes? Whatever your goal and level of skill, this MagBook is your new photographic best friend. The Ultimate Guide to Digital Photography 4 is ideal for any keen photographer - no matter what their level of experience - who wants inside information and ideas on how to enhance and retouch photos on a PC, as well as advice on techniques beyond simply pointing the camera at something and pressing the button. 

Comprehensive and easy-to-follow, this inspirational handbook not only guides you through the different cameras on offer, a crash course in photography theory and PC set up on Windows 7, Vista and XP, but also offers image ideas, advice on storing your photos, hints on editing and retouching using all the best software, as well as providing tips on sharing images online.

The Ultimate Guide To Digital Photography - Fully Updated 4th Edition
